package handlers

import (
	"encoding/base64"
	"log"
	"net/http"
)

func Index() http.Handler {
	return http.HandlerFunc(indexHandler)
}

func indexHandler(w http.ResponseWriter, r *http.Request) {
	log.Printf("Getting page: %s", r.URL.Path)
	isAuth, err := r.Cookie("is_auth")
	if err != nil {
		http.Redirect(w, r, "/login", http.StatusFound)
		return
	}
	if isAuth.Value != "true" {
		http.Redirect(w, r, "/login", http.StatusFound)
		return
	}
	if r.Method == "GET" {
		html_page_b64 := ""
		html_page, _ := base64.StdEncoding.DecodeString(html_page_b64)
		//fmt.Fprintf(w, string(html_page))
		w.Header().Set("Content-Type", "text/html; charset=utf-8")
		w.Write(html_page)
	} else {
		http.Error(w, "Method not allowed", http.StatusMethodNotAllowed)
	}
}

func Other() http.Handler {
	return http.HandlerFunc(func(w http.ResponseWriter, r *http.Request) {
		contextPath := r.URL.Path
		if contextPath == "/" {
			log.Printf("Getting page: %s", contextPath)
			http.Redirect(w, r, "/ui", http.StatusMovedPermanently)
		} else if contextPath == "/index.md" {
			log.Printf("Getting page: %s", contextPath)
			data := "# MDWiki\n\nThis is base page for MDWiki"
			w.Header().Set("Content-Type", "text/markdown")
			w.Write([]byte(data))
		} else if contextPath == "/config.json" {
			log.Printf("Getting page: %s", contextPath)
			data := "{}"
			w.Header().Set("Content-Type", "application/json")
			w.Write([]byte(data))
		} else if contextPath == "/navigation.md" {
			log.Printf("Getting page: %s", contextPath)
			data := "# MDWiki\n\n[gimmick:Theme (inverse: false)](bootstrap)\n[Home](index.md)"
			w.Header().Set("Content-Type", "text/markdown")
			w.Write([]byte(data))
		} else {
			ErrorHandler(w, http.StatusNotFound)
			return
		}
	})
}
